module.exports = "<!-- NG Bootstrap -->\n<section class=\"card\">\n    <div class=\"card-header\">\n        <span class=\"cat__core__title\">\n            <strong>Ng-Bootstrap — Angular Directives for Bootstrap 4</strong>\n            <a href=\"https://ng-bootstrap.github.io/#/home\" target=\"_blank\" class=\"btn btn-sm btn-primary ml-2\">Official Documentation</a>\n        </span>\n    </div>\n    <div class=\"card-body\">\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Accordion</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/accordion\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>The NgbAccordion directive is a collection of panels. It can assure that only panel can be opened at a time.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Accordion -->\n                    <ngb-accordion [closeOthers]=\"true\" activeIds=\"1\">\n                        <ngb-panel id=\"1\" title=\"Simple\">\n                            <ng-template ngbPanelContent>\n                                Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia\n                                aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor,\n                                sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et. Nihil anim keffiyeh helvetica,\n                                craft beer labore wes anderson cred nesciunt sapiente ea proident. Ad vegan excepteur butcher vice lomo. Leggings\n                                occaecat craft beer farm-to-table, raw denim aesthetic synth nesciunt you probably haven't heard of them accusamus\n                                labore sustainable VHS.\n                            </ng-template>\n                        </ngb-panel>\n                        <ngb-panel id=\"2\">\n                            <ng-template ngbPanelTitle>\n                                <span>&#9733; <b>Fancy</b> title &#9733;</span>\n                            </ng-template>\n                            <ng-template ngbPanelContent>\n                                Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia\n                                aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor,\n                                sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et. Nihil anim keffiyeh helvetica,\n                                craft beer labore wes anderson cred nesciunt sapiente ea proident. Ad vegan excepteur butcher vice lomo. Leggings\n                                occaecat craft beer farm-to-table, raw denim aesthetic synth nesciunt you probably haven't heard of them accusamus\n                                labore sustainable VHS.\n                            </ng-template>\n                        </ngb-panel>\n                        <ngb-panel id=\"3\" title=\"Disabled\" [disabled]=\"true\">\n                            <ng-template ngbPanelContent>\n                                Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia\n                                aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor,\n                                sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et. Nihil anim keffiyeh helvetica,\n                                craft beer labore wes anderson cred nesciunt sapiente ea proident. Ad vegan excepteur butcher vice lomo. Leggings\n                                occaecat craft beer farm-to-table, raw denim aesthetic synth nesciunt you probably haven't heard of them accusamus\n                                labore sustainable VHS.\n                            </ng-template>\n                        </ngb-panel>\n                    </ngb-accordion>\n                    <!-- End Accordion -->\n\n                </div>\n            </div>\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Alert</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/alert\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>Alerts can be used to provide feedback messages.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Alert -->\n                    <ngb-alert [dismissible]=\"false\">\n                      <strong>Warning!</strong> Better check yourself, you're not looking too good.\n                    </ngb-alert>\n                    <ngb-alert [dismissible]=\"true\" type=\"success\">\n                      <strong>Success!</strong> This is an success alert\n                    </ngb-alert>\n                    <ngb-alert [dismissible]=\"true\" type=\"info\">\n                      <strong>Info!</strong> This is an info alert\n                    </ngb-alert>\n                    <ngb-alert [dismissible]=\"true\" type=\"warning\">\n                      <strong>Warning!</strong> This is a warning alert\n                    </ngb-alert>\n                    <ngb-alert [dismissible]=\"true\" type=\"danger\">\n                      <strong>Danger!</strong> This is a danger alert\n                    </ngb-alert>\n                    <!-- End Alert -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Buttons</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/buttons\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>Easily create Bootstrap-style radio buttons. A value of a selected button is bound to a variable specified via ngModel.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Buttons -->\n                    <p>Radio Buttons</p>\n                    <div ngbRadioGroup name=\"radioBasic\">\n                        <label class=\"btn btn-primary\">\n                            <input type=\"radio\" [value]=\"1\"> Left (pre-checked)\n                        </label>\n                        <label class=\"btn btn-primary\">\n                            <input type=\"radio\" value=\"middle\"> Middle\n                        </label>\n                        <label class=\"btn btn-primary\">\n                            <input type=\"radio\" [value]=\"false\"> Right\n                        </label>\n                    </div>\n\n                    <br />\n                    <br />\n                    <p>Checkboxes</p>\n                    <div class=\"btn-group\" data-toggle=\"buttons\">\n                      <label class=\"btn btn-default\">\n                        <input type=\"checkbox\"> Left\n                      </label>\n                      <label class=\"btn btn-default\">\n                        <input type=\"checkbox\"> Middle\n                      </label>\n                      <label class=\"btn btn-default\">\n                        <input type=\"checkbox\"> Right\n                      </label>\n                    </div>\n                    <!-- End Buttons -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Carousel</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/carousel\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>Directive to easily create carousels based on Bootstrap's markup.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Carousel -->\n                    <ngb-carousel>\n                        <ng-template ngbSlide>\n                            <img src=\"http://lorempixel.com/900/500?r=1\" alt=\"Random first slide\">\n                            <div class=\"carousel-caption\">\n                                <h3>First slide label</h3>\n                                <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>\n                            </div>\n                        </ng-template>\n                        <ng-template ngbSlide>\n                            <img src=\"http://lorempixel.com/900/500?r=2\" alt=\"Random second slide\">\n                            <div class=\"carousel-caption\">\n                                <h3>Second slide label</h3>\n                                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>\n                            </div>\n                        </ng-template>\n                        <ng-template ngbSlide>\n                            <img src=\"http://lorempixel.com/900/500?r=3\" alt=\"Random third slide\">\n                            <div class=\"carousel-caption\">\n                                <h3>Third slide label</h3>\n                                <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>\n                            </div>\n                        </ng-template>\n                    </ngb-carousel>\n                    <!-- End Carousel -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Collapse</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/collapse\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>The NgbCollapse directive provides a simple way to hide and show an element with animations.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Collapse -->\n                    <p>\n                        <button type=\"button\" class=\"btn btn-outline-primary\" (click)=\"isCollapsed = !isCollapsed\"\n                                [attr.aria-expanded]=\"!isCollapsed\" aria-controls=\"collapseExample\">\n                            Toggle\n                        </button>\n                    </p>\n                    <div id=\"collapseExample\" [ngbCollapse]=\"isCollapsed\">\n                        <div class=\"card\">\n                            <div class=\"card-body\">\n                                You can collapse this card by clicking Toggle\n                            </div>\n                        </div>\n                    </div>\n                    <!-- End Collapse -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Datepicker</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/datepicker\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A lightweight and highly configurable datepicker directive</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Datepicker -->\n                    <ngb-datepicker #dp (navigate)=\"date = $event.next\"></ngb-datepicker>\n                    <!-- End Datepicker -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Dropdown</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/dropdown\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>Transforms a node into a dropdown.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Dropdown -->\n                    <p>Dropdown</p>\n                    <div ngbDropdown class=\"d-inline-block\">\n                      <button class=\"btn btn-default\" id=\"dropdownMenu1\" ngbDropdownToggle>Toggle dropdown</button>\n                      <div class=\"dropdown-menu\" aria-labelledby=\"dropdownMenu1\">\n                        <button class=\"dropdown-item\">Action - 1</button>\n                        <button class=\"dropdown-item\">Another Action</button>\n                        <button class=\"dropdown-item\">Something else is here</button>\n                      </div>\n                    </div>\n                    <!-- End Dropdown -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Modal</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/modal\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A service to open modal windows. Creating a modal is straightforward: create a template and pass it as an argument to the \"open\" method!</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Modal -->\n                    <ng-template #content let-c=\"close\" let-d=\"dismiss\">\n                      <div class=\"modal-header\">\n                        <h4 class=\"modal-title\">Modal title</h4>\n                        <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"d()\">\n                          <span aria-hidden=\"true\">&times;</span>\n                        </button>\n                      </div>\n                      <div class=\"modal-body\">\n                        <p>One fine body&hellip;</p>\n                      </div>\n                      <div class=\"modal-footer\">\n                        <button type=\"button\" class=\"btn btn-default\" (click)=\"c()\">Close</button>\n                      </div>\n                    </ng-template>\n                    <ng-template ngbModalContainer></ng-template>\n                    <button class=\"btn btn-default\" (click)=\"openModal(content)\">Launch demo modal</button>\n                    <!-- End Modal -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Pagination</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/pagination\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A directive that will take care of visualising a pagination bar and enable / disable buttons correctly!</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Pagination -->\n                    <p>Default pagination</p>\n                    <ngb-pagination [collectionSize]=\"70\" [(page)]=\"paginationCurrent\"></ngb-pagination>\n\n                    <p>directionLinks = false</p>\n                    <ngb-pagination [collectionSize]=\"70\" [(page)]=\"paginationCurrent\" [directionLinks]=\"false\"></ngb-pagination>\n\n                    <p>boundaryLinks = true</p>\n                    <ngb-pagination [collectionSize]=\"70\" [(page)]=\"paginationCurrent\" [boundaryLinks]=\"true\"></ngb-pagination>\n                    <!-- End Pagination -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Popover</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/popover\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A lightweight, extensible directive for fancy popover creation.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Popover -->\n                    <div class=\"mb-2\">\n                        <button type=\"button\" class=\"btn btn-default\" placement=\"top\"\n                                ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" popoverTitle=\"Popover on top\">\n                          Popover on top\n                        </button>\n\n                        <button type=\"button\" class=\"btn btn-default\" placement=\"right\"\n                                ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" popoverTitle=\"Popover on right\">\n                          Popover on right\n                        </button>\n                    </div>\n\n                    <div class=\"mb-2\">\n                        <button type=\"button\" class=\"btn btn-default\" placement=\"bottom\"\n                                ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" popoverTitle=\"Popover on bottom\">\n                          Popover on bottom\n                        </button>\n                        <button type=\"button\" class=\"btn btn-default\" placement=\"left\"\n                                ngbPopover=\"Vivamus sagittis lacus vel augue laoreet rutrum faucibus.\" popoverTitle=\"Popover on left\">\n                          Popover on left\n                        </button>\n                    </div>\n                    <!-- End Popover -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Progressbar</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/progressbar\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>Directive that can be used to provide feedback on the progress of a workflow or an action.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Progressbar -->\n                    <p><ngb-progressbar type=\"success\" [value]=\"25\">25</ngb-progressbar></p>\n                    <p><ngb-progressbar type=\"info\" [value]=\"50\">Copying file <b>2 of 4</b>...</ngb-progressbar></p>\n                    <p><ngb-progressbar type=\"warning\" [value]=\"75\" [striped]=\"true\" [animated]=\"true\"><i>50%</i></ngb-progressbar></p>\n                    <p><ngb-progressbar type=\"danger\" [value]=\"100\" [striped]=\"true\">Completed!</ngb-progressbar></p>\n                    <!-- End Progressbar -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Rating</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/rating\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>Rating directive that will take care of visualising a star rating bar.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Rating -->\n                    <style>\n                        .ngb-rating-example .star {\n                          font-size: 1.5rem;\n                          color: #b0c4de;\n                        }\n                        .ngb-rating-example .filled {\n                          color: #1e90ff;\n                        }\n                    </style>\n                    <div class=\"ngb-rating-example\">\n                        <ngb-rating [(rate)]=\"ratingCurrent\">\n                            <ng-template let-fill=\"fill\">\n                                <span class=\"star\" [class.filled]=\"fill === 100\">&#9733;</span>\n                            </ng-template>\n                        </ngb-rating>\n                    </div>\n                    <!-- End Rating -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Tabs</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/tabs\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A component that makes it easy to create tabbed interface.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Tabs -->\n                    <ngb-tabset>\n                      <ngb-tab title=\"Simple\">\n                        <ng-template ngbTabContent>\n                          <div class=\"p-3\">\n                            <p>Raw denim you probably haven't heard of them jean shorts Austin. Nesciunt tofu stumptown aliqua, retro synth\n                              master cleanse. Mustache cliche tempor, williamsburg carles vegan helvetica. Reprehenderit butcher retro keffiyeh\n                              dreamcatcher synth. Cosby sweater eu banh mi, qui irure terry richardson ex squid. Aliquip placeat salvia cillum\n                              iphone. Seitan aliquip quis cardigan american apparel, butcher voluptate nisi qui.</p>\n                          </div>\n                        </ng-template>\n                      </ngb-tab>\n                      <ngb-tab>\n                        <ng-template ngbTabTitle><b>Fancy</b> title</ng-template>\n                        <ng-template ngbTabContent>\n                          <div class=\"p-3\">\n                            <p>Food truck fixie locavore, accusamus mcsweeney's marfa nulla single-origin coffee squid.</p>\n                            <p>Exercitation +1 labore velit, blog sartorial PBR leggings next level wes anderson artisan four loko farm-to-table\n                              craft beer twee. Qui photo booth letterpress, commodo enim craft beer mlkshk aliquip jean shorts ullamco ad vinyl\n                              cillum PBR. Homo nostrud organic, assumenda labore aesthetic magna delectus mollit. Keytar helvetica VHS salvia\n                              yr, vero magna velit sapiente labore stumptown. Vegan fanny pack odio cillum wes anderson 8-bit, sustainable jean\n                              shorts beard ut DIY ethical culpa terry richardson biodiesel. Art party scenester stumptown, tumblr butcher vero\n                              sint qui sapiente accusamus tattooed echo park.</p>\n                          </div>\n                        </ng-template>\n                      </ngb-tab>\n                      <ngb-tab title=\"Disabled\" [disabled]=\"true\">\n                        <ng-template ngbTabContent>\n                          <div class=\"p-3\">\n                            <p>Raw denim you probably haven't heard of them jean shorts Austin. Nesciunt tofu stumptown aliqua, retro synth\n                              master cleanse. Mustache cliche tempor, williamsburg carles vegan helvetica. Reprehenderit butcher retro keffiyeh\n                              dreamcatcher synth. Cosby sweater eu banh mi, qui irure terry richardson ex squid. Aliquip placeat salvia cillum\n                              iphone. Seitan aliquip quis cardigan american apparel, butcher voluptate nisi qui.</p>\n                          </div>\n                        </ng-template>\n                      </ngb-tab>\n                    </ngb-tabset>\n                    <!-- End Tabs -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                    <strong>Timepicker</strong>\n                    <a href=\"https://ng-bootstrap.github.io/#/components/timepicker\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A lightweight & configurable timepicker directive.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Timepicker -->\n                    <ngb-timepicker [(ngModel)]=\"timepickerModel\"></ngb-timepicker>\n                    <!-- End Timepicker -->\n\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                  <strong>Tooltip</strong>\n                  <a href=\"https://ng-bootstrap.github.io/#/components/tooltip\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>A lightweight, extensible directive for fancy tooltip creation.</p>\n                <br />\n                <div class=\"mb-5\">\n\n                    <!-- Tooltip -->\n                    <div class=\"mb-2\">\n                      <button type=\"button\" class=\"btn btn-default\" placement=\"top\" ngbTooltip=\"Tooltip on top\">\n                        Tooltip on top\n                      </button>\n                      <button type=\"button\" class=\"btn btn-default\" placement=\"right\" ngbTooltip=\"Tooltip on right\">\n                        Tooltip on right\n                      </button>\n                    </div>\n\n                    <div class=\"mb-2\">\n                      <button type=\"button\" class=\"btn btn-default\" placement=\"bottom\" ngbTooltip=\"Tooltip on bottom\">\n                        Tooltip on bottom\n                      </button>\n                      <button type=\"button\" class=\"btn btn-default\" placement=\"left\" ngbTooltip=\"Tooltip on left\">\n                        Tooltip on left\n                      </button>\n                    </div>\n                    <!-- End Tooltip -->\n\n                </div>\n            </div>\n\n            <div class=\"col-lg-6\">\n                <h4 class=\"text-black\">\n                  <strong>Typeahead</strong>\n                  <a href=\"https://ng-bootstrap.github.io/#/components/typeahead\" target=\"_blank\" class=\"btn btn-sm ml-2\">Detailed Documentation</a>\n                </h4>\n                <p>NgbTypeahead directive provides a simple way of creating powerful typeaheads from any text input</p>\n                <br />\n                <div class=\"mb-5\">\n\n                  <!-- Typeahead -->\n                  <input type=\"text\" class=\"form-control\" [(ngModel)]=\"typeaheadModel\" [ngbTypeahead]=\"typeaheadSearch\" />\n                  <!-- End Typeahead -->\n\n                </div>\n              </div>\n        </div>\n    </div>\n</section>\n<!-- End NG Bootstrap -->\n"

